import React from 'react';
import styles from './introduce1.module.css';

const Introduce1 = () => (
  <div style={{ display: 'flex' }}>
    <span style={{ width: '60%' }}>
      <h3>
        프론트엔드 개발자를 꿈꾸는 황인상입니다.
        <br />
        컴퓨터를 좋아해서 컴퓨터 소프트웨어 공학과 4년제를 전공했고,
        <br />
      </h3>
    </span>
    <span style={{ width: '40%' }}>
      <div className={styles.me} />
    </span>
  </div>
);

export default Introduce1;
